import React, { useEffect } from 'react';
import { connect, useDispatch } from 'react-redux';
import mapStoreToProps from '../../redux/mapStoreToProps';
import "./Map.css";


function Map(props) {

  const dispatch = useDispatch();

  const url = `https://www.google.com/maps/embed/v1/view?key=${props.store.key}&center=44.764409,-93.279372&zoom=20&maptype=satellite`;

  useEffect(() => {
    dispatch({
      type: 'GET_KEY',
    });
  }, []);
  const getKey = () => {
    console.log('in getKey: step 1');


  }

  return (
    <div className="row w-100">
      <iframe
        title="unique title"
        width="100%"
        height="600"
        frameBorder="0"
        src={url}
        allowFullScreen>
      </iframe>
      <button onClick={getKey}>Get Key</button>
    </div>
  );
}

export default connect(mapStoreToProps)(Map);
